<div class="container mx-auto">
    {{-- page title --}}
    @section('title', config('app.name') . ' Linux - ' . 'Built on Open Source')
    <div id="content" class="pt-12">
        <div class="w-full text-center">
            <div class="max-w-3xl mx-auto text-center">
                <h1 class="text-3xl font-semibold">We're Built on Open Source</h1>
                <h4 class="text-xl">The Avouch Linux is built upon a strong foundation of Free &amp; Open Source software. Without projects such as these, Avouch Linux would not exist.</h4>
            </div>
        </div>
        <div class="sm:flex sm:pt-12 sm:gap-4">
            <div class="">
                <h3 class="text-center text-2xl font-semibold">Security &amp; Privacy</h3>
                <p class="pt-4 text-left">By being Open Source, Avouch Linux can benefit from superior security and privacy over closed source software. When the source code is available to audit, anyone in the community, whether a security researcher, a concerned user, or an OEM shipping the OS on their hardware, can ensure the software is secure and not collecting or leaking personal information.</p>
            </div>
            <div class="">
                <h3 class="text-center text-2xl font-semibold">Better for Developers</h3>
                <p class="pt-4 text-left">If your app could benefit from a system API or feature thatâ€™s not yet available, you can help write that feature into the OS. Similarly, you might be curious as to how a feature or design pattern in Avouch Linux was made. Instead of guessing or trying to reimplement it on your own, you can just look at the underlying source code for a definitive answer.</p>
            </div>
        </div>
        <div class="p-12 text-center text-2xl font-semibold">
            <h2 class="text-2xl">Open Source Projects</h2>
        </div>
